An old-wives-tale is to eat #sweetpotatoes for #depression; 

for they too know Darkness (from being under ground) 

but inside: are filled with vibrant Light, (bright orange interior color). 

 ... A reminder to us that we too can be "dug up" &amp; broadcast beauty into the world...

